PROCESS INSTRUCTIONS:
Avail. Mon-Thu before 3 PM only.  Next Generation Sequencing. This panel detects most known genetic causes of HLH: familial hemophagocytic lymphohistiocytosis (PRF1, UNC13-D, STX11, STABP2), X- linked lymphoproliferative (XLP
) syndromes 1 and 2 (SH2D1A and XIAP), ITK deficiency (ITK), Hermansky-Pudlak syndrome types 2 and 9 (AP3B1 and BLOC1S6),Chediak-Higashi syndrome (LYST), CD27 deficiency (CD27), XMEN syndrome and lysinuric protein intolerance
 (SLC7A7). Mutations in MAGT1 have not been associated with HLH to date, but it is included in this panel to gain knowledge about its association.

BAL fluid: Transfer to a sterile container;

Swab (FLOQSwab only)/Tissue: Place in viral transport media. 

Place each specimen in an individually sealed bag.  Deliver ASAP to lab.
